import React from "react";
import {Router,Route} from 'react-router-dom'
import Home from "./pages/homepage/Home";
import Survey from "./pages/surveys/Survey";


function App() {
  return (
    <Router>
      <Route path="/" element={<Home/>}/>
      <Route path="/survey" element={<Survey/>}/>

    </Router>
  );
}

export default App;
